	"nmFranquicia"	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "tb_EstadosCartera" (
	"idEstadoCartera"	INTEGER NOT NULL,
	"nmEstadoCartera"	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "tbCarteraMes" (
	"nmCiudad"	VARCHAR(20) NOT NULL,
	"nmOficina"	VARCHAR(40) NOT NULL,
	"clApellidos"	VARCHAR(30) NOT NULL,
	"clNombres"	VARCHAR(30) NOT NULL,
	"clNombreCompleto"	VARCHAR(60) NOT NULL,
	"idTarjeta"	VARCHAR(11) NOT NULL,
	"idFranquicia"	VARCHAR(20) NOT NULL,
	"ctDiasMora"	INTEGER NOT NULL,
	"vlCupoAprobado"	REAL NOT NULL,
	"vlPagoFacturado"	REAL NOT NULL,
	"vlSaldoActual"	REAL NOT NULL,
	"idEstadoCartera"	VARCHAR(20) NOT NULL
